package org.zstack.header.vm;

import org.zstack.header.message.APIEvent;
import org.zstack.header.rest.RestResponse;

/**
 * @author shanshan.ning
 * @date 2023-09-11
 */
@RestResponse(fieldsTo = {"imageData"})
public class APITakeVmConsoleScreenshotEvent extends APIEvent {
    private String imageData;

    public APITakeVmConsoleScreenshotEvent() {
    }

    public APITakeVmConsoleScreenshotEvent(String apiId) {
        super(apiId);
    }

    public String getImageData() {
        return imageData;
    }

    public void setImageData(String imageData) {
        this.imageData = imageData;
    }

    public static APITakeVmConsoleScreenshotEvent __example__() {
        APITakeVmConsoleScreenshotEvent event = new APITakeVmConsoleScreenshotEvent();
        event.setImageData("data:image/jpg;base64,");
        return event;
    }
}
